import {
  Person as PersonIcon,
  Badge as BadgeIcon
} from '@mui/icons-material';
import {
  Box,
  Typography,
  Card,
  CardContent,
  Grid,
  Chip,
  Divider,
  CircularProgress,
  Alert
} from '@mui/material';
import { blueGrey, blue } from '@mui/material/colors';
import { useEffect, useState } from 'react';
import { useFetch } from '../../hooks';
import { API, getURI } from '../../services';

interface IPilotInfo {
  id?: number;
  userId: number;
  firstName: string;
  lastName: string;
  cpf: string;
  cellphone: string;
  email: string;
  status: string;
}

interface PilotInfoProps {
  pilot: IPilotInfo;
}

export const PilotInfo = ({ pilot: initialPilot }: PilotInfoProps) => {
  const { userId } = useParams<{ userId: string }>();
  const [pilot, setPilot] = useState<IPilotInfo | null>(null);

  const {
    data: pilotData,
    error: pilotError,
    loading: pilotLoading
  } = useFetch<IPilotInfo>({
    url: getURI(`${API.pilots}/${userId}`)
  });

  useEffect(() => {
    if (pilotData) {
      setPilot(pilotData);
    }
  }, [pilotData]);

  if (pilotLoading) {
    return (
      <Box
        display="flex"
        justifyContent="center"
        alignItems="center"
        minHeight="400px"
      >
        <CircularProgress />
      </Box>
    );
  }

  if (pilotError || !pilot) {
    return (
      <Box sx={{ padding: '15px' }}>
        <Alert severity="error">
          Piloto não encontrado.
        </Alert>
      </Box>
    );
  }

  return (
    <Card elevation={3} sx={{ mb: 0 }}>
      <CardContent>
        <Box display="flex" alignItems="center" mb={3}>
          <PersonIcon sx={{ fontSize: 40, color: blue[500], mr: 2 }} />
          <Box>
            <Typography variant="h4" component="h1">
              {pilot.firstName} {pilot.lastName}
            </Typography>
            <Chip
              label={pilot.status}
              color="primary"
              size="small"
              sx={{ mt: 1 }}
            />
          </Box>
        </Box>

        <Divider sx={{ mb: 1 }} />

        <Grid container spacing={3}>
          <Grid item xs={12} md={6}>
            <Typography variant="h6" gutterBottom color="primary">
              Informações Pessoais:
            </Typography>

            <Box display="flex" alignItems="center" mb={2}>
              <BadgeIcon sx={{ mr: 1, color: blueGrey[500] }} />
              <Box>
                <Typography variant="body2" color="textSecondary">
                  CPF
                </Typography>
                <Typography variant="body1">{pilot.cpf}</Typography>
              </Box>
            </Box>

            <Box display="flex" alignItems="center" mb={2}>
              <Typography
                variant="body2"
                color="textSecondary"
                sx={{ mr: 2, minWidth: '80px' }}
              >
                Celular:
              </Typography>
              <Typography variant="body1">{pilot.cellphone}</Typography>
            </Box>

            <Box display="flex" alignItems="center" mb={2}>
              <Typography
                variant="body2"
                color="textSecondary"
                sx={{ mr: 2, minWidth: '80px' }}
              >
                E-mail:
              </Typography>
              <Typography variant="body1">{pilot.email}</Typography>
            </Box>
          </Grid>
        </Grid>
      </CardContent>
    </Card>
  );
};
